import back from "@/components/Botton/back.vue";
import { apiGetActivityBetResult } from "@/api/ClubActivitys.js";
export default {
  components: {
    back: back
  },
  data: function data() {
    return {
      lang: "",
      ActiveId: "",
      matchResultDetailObj: [],
      noData: false,
      push: false
    };
  },
  created: function created() {
    localStorage.setItem("categoryIndex", 1);
    this.lang = JSON.parse(localStorage.getItem("lang")).tag;
    this.ActiveId = localStorage.getItem("AcvtiveId");
    this.getResultDetail();
  },
  methods: {
    getResultDetail: function getResultDetail() {
      var _this = this;

      this.push = true;
      var data = {
        ClubActivityId: this.ActiveId
      };
      apiGetActivityBetResult(data, true).then(function (res) {
        if (res.Code == "600") {
          _this.push = false;
          _this.noData = true;
          var vm = _this;
          var m = vm.$message({
            message: res.Message,
            duration: 3000,
            type: "error",
            center: true
          });
          setTimeout(function () {
            return m.close();
          }, 2000);
        } else if (res.Data.length > 0) {
          _this.noData = false;
          _this.push = false;
          _this.matchResultDetailObj = res.Data;
        }
      });
    }
  },
  beforeDestroy: function beforeDestroy() {
    localStorage.setItem("categoryIndex", 1);
  }
};
